**Root Dry Matter Demands**

Demands for structural, metabolic and storage pools are provided to the organ arbitrator to simulate ongoing stem growth.  The demands for each dry matter pool are calculated as follows:

```
{[Wheat].Root.DMDemands.Structural.PotentialRootGrowth}
{[Wheat].Root.DMDemands.Structural}
{[Wheat].Root.DMDemands.Structural.StructuralFraction}
Storage = 0
{[Wheat].Root.DMDemands.Metabolic}
```

Potential root growth is calculated as a fraction of total plant growth as a function of growth stage.
{[Wheat].Root.DMDemands.Structural.PotentialRootGrowth.PartitionFraction.PreGrainFilling.PartitionFraction}

**Root Nitrogen Demand and Allocation**

Root Nitrogen allocation to structural, storage and metabolic biomass pools is calculated by the OrganArbitrator as described above.  The root model calculates the demands for each of these pools from information on the minimum, critical and maximum Nitrogen concentration for each predicted stage of development.

The minimum nitrogen concentration is used to describe the nitrogen content of the structural material. The difference between minimum and critical nitrogen concentration is assumed to correspond to metabolic stem material.  Storage nitrogen is equated with the difference between maximum and critical nitrogen concentrations.  The values of each of these is specified as follows.

```
// minimum, critical and maximum n concentrate are set to be equal
// to provide a configuration where stem N is held in the structural pool only.
{[Wheat].Root.MinimumNconc}
{[Wheat].Root.CriticalNconc}
{[Wheat].Root.MaximumNconc}
```
Storage N is parameterised therefore as the difference between minimum/critical N concentration and the following maximum N concentration.
{[Wheat].Root.MaximumNconc}

**Senescence and Detachment**

Root senescence and turnover is specified to occur throughout the entire crop.

```
{[Wheat].Root.SenescenceRate}
```

**Spike Dry Matter Demands**

Demands for structural, metabolic and storage pools are provided to the organ arbitrator to simulate ongoing stem growth.  The demands for each dry matter pool are calculated as follows:

```
{[Wheat].Spike.PotentialGrowth}
   {[Wheat].Spike.PotentialGrowth.EmergenceToRapidGrainFill.PotentialGrowth}
   {[Wheat].Spike.PotentialGrowth.EmergenceToRapidGrainFill.PotentialGrowth.TargetWt}
   {[Wheat].Spike.PotentialGrowth.EmergenceToRapidGrainFill.PotentialGrowth.TargetWt.PotentialAboveGroundWt}

{[Wheat].Spike.DMDemands.Structural}
{[Wheat].Spike.DMDemands.Structural.StructuralFraction}

{[Wheat].Spike.DMDemands.Storage}
{[Wheat].Spike.DMDemands.Metabolic}


```

The fraction of daily growth partitioned to stems is specified as a function of growth stage.

{[Wheat].Spike.PotentialGrowth.EmergenceToRapidGrainFill.PotentialGrowth.TargetWt.SpikeFraction}

**Spike Nitrogen Demand and Allocation**

Spike Nitrogen allocation to structural, storage and metabolic biomass pools is calculated by the OrganArbitrator as described above.  The stem model calculates the demands for each of these pools from information on the minimum, critical and maximum stem Nitrogen concentration for each predicted stage of development.

The minimum stem nitrogen concentration is used to describe the nitrogen content of the structural stem material. The difference between minimum and critical nitrogen concentration is assumed to correspond to metabolic stem material.  Storage nitrogen is equated with the difference between maximum and critical nitrogen concentrations.  The values of each of these is specified as follows.

```
// minimum and critical are set to be equal to provide a configuration where stem N is held in structural and storage pools only.
{[Wheat].Spike.MinimumNconc}
{[Wheat].Spike.CriticalNconc}
```
Storage N is parameterised therefore as the difference between minimum/critical N concentration and the following maximum N concentration.
{[Wheat].Spike.MaximumNconc}

**Senescence and Detachment**

Spike senescence is specified to occur after the end of grain filling such that there is total stem senescence by the harvest ripe phase.  

```
if the current growth stage is between EndGrainFill and HarvestRip
   SenescenceRate = min (1.0, ThermalTime/ThermalTimeRemaining)
ThermalTimeRemaining = GrainFilling.Target - GrainFilling.ProgressThroughPhase
{[Wheat].Spike.DetachmentRateFunction}

```

where

Name | Description | Units
-|-|-
SenescenceRate | Fraction of live stem that senesces on the current day | /day
ThermalTime | Daily thermal time calculated by the phenology model | <sup>o</sup>C
ThermalTimeRemaining | Amount of thermal time remaining within the Grain Filling phase | <sup>o</sup>C
GrainFilling.Target | Total amount of thermal time required to meet the grain filling phase |  <sup>o</sup>C
GrainFilling.ProgressThroughPhase | Total thermal time already accumulated within the grain filling phase | <sup>o</sup>C

**DM and N reuse within the plant**

Non-structural DM and N (ie storage or metabolic pools) can be available for reuse elsewhere within the plant to meet other demands via reallocation of DM or N from senescing biomass or retranslocation from live biomass during some growth phases (e.g. reallocation of N from senescing stem or retranslocation from stem N storage to support protein accumulation in grain during grain filling.  The potential fraction of DM or N that is available on any day is specified as follows:

```
{[Wheat].Spike.DMRetranslocationFactor}
{[Wheat].Spike.DMReallocationFactor}
{[Wheat].Spike.NRetranslocationFactor}
{[Wheat].Spike.NReallocationFactor}

```

